import Document, { Head, Main, NextScript } from "next/document";

const MyDocument = () => {
  return (
    <html>
      <Head>
        <title>Hello world</title>
      </Head>

      <body>
        <Main />
        <NextScript />
      </body>
    </html>
  );
};

export default MyDocument;
